import logo from './logo.svg';
import './App.css';
import products from './data.js'
import Card from './components/Card.jsx'
import Category from './components/Catergory.jsx'
function App() {
  console.log(products)
  return (
    <div className="App">
      <Category></Category>
      {
        products.map(productData => <Card image = {productData.image} title = {productData.title} price = {productData.price} description = {productData.description} />)
      }
    </div>
  );
}

export default App;
